import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {

    const closeHiddenMenu = (event) => {
        event.target.parentElement.style.left = "-60%";
    }

    return (
        <nav className="navbar navbar-expand-md navbar-dark bg-secondary px-2">
            <a className="navbar-brand" href="https://redux.js.org" target="_blank" rel="noreferrer">Redux</a>
            <div>
                <a className="nav-link nav-item"><Link to="/shop" style={{color : "white" , textDecoration : "none"}}>Shop</Link></a>
                <a className="nav-link nav-item"><Link to="/users" style={{color : "white" , textDecoration : "none"}}>Users</Link></a>
            </div>
        </nav>
    );
}

export default Navbar;
